/* global google */

import React, { Suspense, useState } from "react";
import { ThemeProvider } from "styled-components";
import { theme } from "../../style/theme";
import GlobalStyles from "../../style/globalstyles";
import { MainContainer } from "./styles";
import { ToastContainer } from "react-toastify";
import GoogleMapReact from "google-map-react";
import { useEffect } from "react";
import axios from "axios";

const App = () => {
  const defaultProps = {
    //  you can get user location also to make that center ,
    //  for simplicity i am using hardcoded value here
    center: {
      lat: 51.91572648399697,
      lng: 4.43452841645066,
    },
    zoom: 11,
  };

  useEffect(() => {
    axios
      .get(
        `https://api.openweathermap.org/data/2.5/weather?q=London&appid=a244ad62343d4ebf74fd4bda18cb7cbf`
      )
      .then((data) => {
        console.log(data);
      })
      .catch((e) => {
        console.log(e);
      });
  }, []);

  function heatMapData() {
    return {
      positions: [{ lat: 37.782551, lng: -122.445368 }],
      options: {},
    };
  }
  return (
    <>
      <ThemeProvider theme={theme}>
        <GlobalStyles />
        <MainContainer>
          <GoogleMapReact
            bootstrapURLKeys={{
              key: "AIzaSyAWZueg5Aov0-mEgFk5qdKUWI0T-tZYMww",
            }}
            heatmapLibrary={true}
            heatmap={heatMapData()}
            defaultCenter={defaultProps.center}
            defaultZoom={defaultProps.zoom}
          />
        </MainContainer>

        <ToastContainer />
      </ThemeProvider>
    </>
  );
};

export default App;
